import Axios from "axios";

const host = "http://127.0.0.1:4567"

const AxiosPost = (link, data) => {
    let response;
    Axios.post(`${host}${link}`, data).then((res) => {
        response = res;
        console.log(response)
    })

    return response;
}

export {AxiosPost};
